import React from 'react';

function Carousel() {
  return (
    <div className="carousel">
      <img src="/assets/images/banner.jpg" alt="Banner" />
      {/* Use a library like react-bootstrap-carousel if needed */}
    </div>
  );
}

export default Carousel;
